package sdtlab.patient_module.domain;import jakarta.persistence.*;import lombok.Getter;import lombok.Setter;import java.sql.Date;@Setter@Getter@Entitypublic class Doctor extends Person {    @Id    @GeneratedValue    private Long id;    private Long doctorId;    private Specializations specialization;    public Doctor(String firstName, String lastName, String email, String phone, String address, String gender, Date dob, Long doctorId, Specializations specialization) {        super(firstName, lastName, email, phone, address, gender, dob);        this.doctorId = doctorId;        this.specialization = specialization;    }    public Doctor() {    }}